  // this works and does not write to file to do it!!!
  def blockDataToBase64ImageString(data : String) = {
    val nodetext = data.filter(c => c > ' ') // remove control chars (anything above space)
//    println(s"node is ${StrUtil.shortString(nodetext)}")
    val encoded = decodeUnpackEncodeString(nodetext)
  //  println("inflated string is " + StrUtil.shortString(infl))
    encoded
  }

  private def simpleEncode(source: Array[Byte]) : String = {
    val inStream = new ByteArrayInputStream(source)
    val outStream = new ByteArrayOutputStream
    // This is the key to the whole thing....
    // This is the only way to get rid of the 4 useless chars that tell the length.
    // no deletion of those chars will work, nor will getBytes.drop(4)
    inStream.skip(4)
    StringUtilities.base64StreamEncode(inStream, outStream)
    inStream.close()
    outStream.close()
    outStream.toString()
  }

  private def decodeUnpackEncodeString(source: String) : String = {
    val inStream = new ByteArrayInputStream(source.getBytes)
    val outStream = new ByteArrayOutputStream
    val inflater = new InflaterOutputStream(outStream)
    StringUtilities.base64StreamDecode(inStream, inflater)
    inflater.flush()
    outStream.flush()
    inStream.close()
    inflater.close()
    outStream.close()
    simpleEncode(outStream.toByteArray)
  }

}

